// Guitar - Realistic style, medium complexity
// Overall length ~90mm, printable at 1:1 scale

$fn = 32;  // Smooth curves
body_t = 2.5;  // Wall thickness

module body() {
    // Main guitar body shape
    hull() {
        // Upper bout
        translate([-15, 30, 0]) scale([0.8, 1, 1]) sphere(d=25);
        // Lower bout
        translate([-20, -25, 0]) scale([1.2, 1, 1]) sphere(d=35);
        // Waist
        translate([-5, 5, 0]) scale([0.6, 0.8, 1]) sphere(d=20);
    }
}

module sound_hole() {
    // Sound hole in center
    translate([0, 0, body_t/2]) cylinder(h=body_t, d=10, $fn=64);
}

module bridge() {
    // Bridge for strings
    translate([0, -20, 0]) {
        difference() {
            cube([20, 6, 1.5], center=true);
            for(i = [-2:1:2]) {
                translate([i*3.5, 0, 0.5]) cylinder(h=2, d=1.5);
            }
        }
    }
}

module neck() {
    // Guitar neck
    translate([0, 35, 0]) {
        // Neck shaft
        cube([6, 45, 3.5], center=true);

        // Headstock
        translate([0, 27, 0]) {
            cube([12, 18, 2.5], center=true);
        }

        // Nut
        translate([0, 19, 2.5]) cube([7, 1, 0.5], center=true);
    }
}

module frets() {
    // Frets along neck
    for(i = [0:18]) {
        y = 22 + i * 2.2;
        scale_factor = 1 - (i * 0.015);
        translate([0, y, 3.5]) scale([scale_factor, 1, 1]) cube([5.5, 0.5, 0.3], center=true);
    }
}

module tuners() {
    // Tuning pegs on headstock
    for(i = [-2:1:2]) {
        // Left side
        translate([-8, 35 + i*3.5, 0]) rotate([90, 0, 0]) cylinder(h=4, d=2);
        // Right side
        translate([8, 35 + i*3.5, 0]) rotate([90, 0, 0]) cylinder(h=4, d=2);
    }
}

module strings() {
    // Simplified strings
    for(i = [-2:1:2]) {
        x = i * 1.5;
        color("silver") {
            // From bridge to nut
            hull() {
                translate([x, -20, 1.5]) sphere(d=0.4);
                translate([x, 19, 3.5]) sphere(d=0.4);
            }
            // From nut to tuner
            hull() {
                translate([x, 19, 3.5]) sphere(d=0.4);
                translate([x*0.7 + (i>0?8:-8), 35 + i*3.5, 2]) sphere(d=0.4);
            }
        }
    }
}

// Main assembly
difference() {
    union() {
        // Body with thickness
        linear_extrude(height=body_t) body();

        // Neck and headstock
        neck();

        // Bridge
        bridge();

        // Tuners
        tuners();
    }

    // Cut sound hole
    sound_hole();
}

// Add frets
frets();

// Add strings
strings();

// Realistic 3D-printable violin (medium complexity)
