        union() {
            translate([-4,0,0]) cube([2,4,3], center=true);
            translate([4,0,0]) cube([2,4,3], center=true);
            // bridge arch
            translate([0,0,1.5])
                cube([8,1,3], center=true);
        }
}

module f_holes() {
    // left f-hole
    translate([-5,8,9])
        rotate([0,0,-25])
            difference() {
                union() {
                    cylinder(d=2.5, h=1, center=true);
                    translate([0,8,0]) cylinder(d=2.5, h=1, center=true);
                    translate([0,4,0]) cube([2,8,1], center=true);
                }
                translate([1,4,0]) cylinder(d=1, h=2, center=true);
            }
    // right f-hole
    mirror([1,0,0])
        translate([-5,8,9])
            rotate([0,0,25])
                difference() {
                    union() {
                        cylinder(d=2.5, h=1, center=true);
                        translate([0,8,0]) cylinder(d=2.5, h=1, center=true);
                        translate([0,4,0]) cube([2,8,1], center=true);
                    }
                    translate([1,4,0]) cylinder(d=1, h=2, center=true);
                }
}

module tailpiece() {
