module rounded_box(x,y,z,r) {
    // Simple rounded-corner box, printable without supports
    hull() {
        for(i=[-1,1], j=[-1,1], k=[-1,1])
            translate([i*(x/2-r), j*(y/2-r), k*(z/2-r)])
                sphere(r=r, $fn=12);
    }
}

module body() {
    // Main body shape: double-cutaway bass body
    difference() {
        // Overall body silhouette
        hull() {
            translate([0,-25,0]) scale([1.4,1,1]) sphere(d=40, $fn=60);
            translate([0, 25,0]) scale([1.2,1,1]) sphere(d=30, $fn=60);
        }
        // Neck pocket
        translate([0,0,2]) cube([12,55,10], center=true);
        // Control cavity (printable from bottom)
        translate([18,-15,2]) cube([20,25,6], center=true);
    }
}

module neck() {
    // One-piece neck+headstock
    color("BurlyWood") union() {
        // Neck shaft
        translate([0,0,3]) cube([8,50,3], center=true);
        // Headstock
        translate([0,-30,1]) cube([12,20,1.5], center=true);
    }
}

module fretboard() {
    // Fretboard with frets
    color("DarkGray") difference() {
        translate([0,-10,4.5]) cube([9,40,1], center=true);
        // Side dots
        for(pos=[-15,-5,5,15])
            translate([4.5,pos,4.5]) cylinder(d=1,h=1.2,$fn=8);
    }
    // Frets
