// Realistic 3D-Printable Banjo (medium complexity)
// Overall length ~85 mm, designed for FDM printing

// Parameters
body_dia = 45;
body_thick = 8;
neck_len = 60;
neck_w = 8;
neck_h = 12;
head_dia = 47;
head_thick = 1.2;
bridge_h = 4;
bridge_w = 15;
bridge_d = 2;
tuner_d = 4;
tuner_h = 3;
string_d = 0.8;
num_strings = 5;
peg_h = 10;
peg_r = 2.5;

// Main assembly
module banjo(){
    union(){
        // Pot assembly
        pot_assembly();

        // Neck & fingerboard
        translate([0,0,body_thick/2+neck_h/2])
            neck_assembly();

        // Headstock
        translate([neck_len,0,body_thick/2+neck_h-1])
            headstock();
    }
}

// Resonator pot with tone ring
module pot_assembly(){
    difference(){
        // Main pot body
        cylinder(d=body_dia, h=body_thick, $fn=64);

        // Hollow cavity
        translate([0,0,2])
            cylinder(d=body_dia-6, h=body_thick, $fn=64);

        // Tailpiece hole
        translate([body_dia/2-3,0,body_thick/2])
            rotate([90,0,0])
                cylinder(d=3, h=10, $fn=16);
    }

    // Tone ring flange
    translate([0,0,body_thick-1])
        cylinder(d1=body_dia+2, d2=body_dia, h=2, $fn=64);

    // Drum head membrane
    translate([0,0,body_thick+1])
        cylinder(d=head_dia, h=head_thick, $fn=64);

    // Bridge
    translate([0,0,body_thick+head_thick+bridge_h/2+1])
        cube([bridge_d, bridge_w, bridge_h], center=true);

    // Tailpiece
    translate([body_dia/2-2,0,body_thick/2])
        rotate([0,90,0])
            cylinder(d=5, h=8, $fn=16);
}

// Neck with frets
module neck_assembly(){
    // Neck core
    cube([neck_len, neck_w, neck_h], center=true);

    // Fingerboard overlay
    translate([0,0,neck_h/2+0.6])
        cube([neck_len, neck_w+2, 1.2], center=true);

    // Frets (18 frets)
    for(i=[1:18]){
        fret_pos = -neck_len/2 + i*3.2;
        translate([fret_pos,0,neck_h/2+1.8])
            cube([0.5, neck_w+2, 1], center=true);
    }

    // Heel
    translate([-neck_len/2-3,0,0])
        rotate([0,90,0])
            cylinder(d=neck_h+2, h=neck_w+4, $fn=32);
}

// Headstock with tuners
module headstock(){
    difference(){
        // Peghead shape
        translate([0,0,peg_h/2])
            cube([20, neck_w+6, peg_h], center=true);

        // Tuner holes on left
        for(i=[0:2]){
            translate([-5, neck_w/2+3, 2+i*2.5])
                rotate([90,0,0])
                    cylinder(d=tuner_d, h=10, $fn=16);
        }

        // Tuner holes on right
        for(i=[0:2]){
            translate([-5, -neck_w/2-3, 2+i*2.5])
                rotate([90,0,0])
                    cylinder(d=tuner_d, h=10, $fn=16);
        }
    }

    // Pegs
    for(i=[0:num_strings-1]){
        y_pos = (i-2)*(neck_w+6)/5;
        translate([10, y_pos, peg_h/2])
            rotate([0,90,0])
                cylinder(d=peg_r*2, h=peg_h, $fn=12);
    }

    // Nut
    translate([-10,0,peg_h+1])
        cube([1, neck_w+2, 1.5], center=true);
}

// Generate model
banjo();

// Mandolin - medium complexity realistic style
// Designed for 3D printing, ~75mm long

body_length = 70;
body_width = 40;
body_depth = 12;
neck_length = 80;
neck_width = 8;
headstock_length = 20;
headstock_width = 12;
fretboard_length = 60;
bridge_height = 5;
tuning_peg_diameter = 2;
tuning_peg_length = 8;
string_thickness = 0.5;
soundhole_radius = 8;
wall_thickness = 2;

module mandolin() {
    // Main body
    difference() {
        // Body shell
        hull() {
            translate([-body_length/2, 0, 0])
                scale([1, 0.7, 1])
                sphere(d=body_width);
            translate([body_length/2*0.7, 0, 0])
                sphere(d=body_width*0.9);
        }

        // Hollow interior
        scale([0.8, 0.8, 0.7])
        translate([0, 0, -wall_thickness])
        hull() {
            translate([-body_length/2*0.9, 0, 0])
                scale([1, 0.7, 1])
                sphere(d=body_width*0.8);
            translate([body_length/2*0.7, 0, 0])
                sphere(d=body_width*0.7);
        }
    }

    // Sound hole
    translate([body_length*0.2, 0, body_depth-0.5])
        cylinder(h=wall_thickness+1, r=soundhole_radius, $fn=32);

    // Bridge
    difference() {
        translate([body_length*0.3, 0, body_depth])
            cube([12, 6, bridge_height], center=true);
        translate([body_length*0.3, 0, body_depth])
            cube([14, 8, bridge_height-1], center=true);
    }

    // Neck
    translate([body_length/2 + neck_length/2, 0, body_depth/2])
        rotate([0, 90, 0])
        cylinder(h=neck_length, r=neck_width/2, $fn=8);

    // Fretboard
    translate([body_length/2 + fretboard_length/2, 0, body_depth-1])
        cube([fretboard_length, neck_width+4, 2], center=true);

    // Headstock
    translate([body_length/2 + neck_length + headstock_length/2, 0, body_depth/2])
        rotate([0, 90, 0])
        cube([headstock_length, headstock_width, 4], center=true);

    // Tuning pegs
    for(i=[-1, 1]) {
        for(j=[0, 1, 2, 3]) {
            translate([
                body_length/2 + neck_length + headstock_length*0.7,
                (j < 2 ? -headstock_width/2 - 3 : headstock_width/2 + 3),
                body_depth/2 + (j % 2 == 0 ? 2 : -2) + i*1
            ]) {
                rotate([0, 90, 0])
                cylinder(h=tuning_peg_length, r=tuning_peg_diameter/2, $fn=8);
            }
        }
    }

    // Strings
    for(i=[-1.5, -0.5, 0.5, 1.5]) {
        translate([body_length/2 + neck_length + headstock_length - 5, 
                   i*1.5, 
                   body_depth/2 + 2])
            rotate([0, 90, 0])
            cylinder(h=neck_length + fretboard_length, r=string_thickness/2, $fn=4);
    }

    // Tailpiece
    translate([-body_length/2*0.9, 0, body_depth-1])
        cube([6, 12, 3], center=true);
}

// Scale to 3D printable size
scale(0.8)
mandolin();

// Ukulele model - medium complexity
// Designed for 3D printing, approximately 80mm long
$fn = 32;

module ukulele() {
    // Main body - hollowed elliptical shape
    difference() {
        scale([1, 0.7, 0.3]) sphere(d = 50);
        translate([0, 0, -1]) scale([0.9, 0.6, 0.4]) sphere(d = 50);
    }

    // Sound hole
    translate([0, 0, 2.9]) cylinder(h = 2, d = 20);

    // Bridge
    translate([0, -15, 3]) {
        cube([20, 8, 2], center = true);
        for(i = [-8:4:8]) {
            translate([i, 0, 1]) cylinder(h = 2, d = 1);
        }
    }

    // Neck
    translate([0, 25, 0]) rotate([90, 0, 0]) {
        // Neck shaft
        difference() {
            cube([6, 35, 12], center = true);
            translate([0, 10, 0]) cube([4, 30, 10], center = true);
        }

        // Headstock
        translate([0, 22, 0]) {
            difference() {
                cube([12, 15, 6], center = true);
                translate([0, -3, 0]) cube([10, 8, 8], center = true);
            }

            // Tuning pegs
            for(side = [-1, 1]) {
                for(pos = [0, 1]) {
                    translate([side * 5, 3 + pos * 6, 3]) 
                        rotate([0, 90, 0]) cylinder(h = 8, d = 3);
                }
            }
        }

        // Frets
        for(fret = [1:12]) {
            translate([0, -15 + fret * 2.5, 6.1]) 
                cube([6.2, 0.5, 1], center = true);
        }
    }

    // Strings
    for(str = [-1.5, -0.5, 0.5, 1.5]) {
        hull() {
            // Bridge to nut
            translate([str, -15, 4]) cylinder(h = 0.5, d = 0.5);
            translate([str, 25, 6]) cylinder(h = 0.5, d = 0.5);
            // Nut to tuning peg
            translate([str, 25, 6]) cylinder(h = 0.5, d = 0.5);
            translate([str * 1.2, 32, 3]) cylinder(h = 0.5, d = 0.5);
        }
    }

    // Side binding detail
    difference() {
        scale([1.05, 0.75, 0.32]) sphere(d = 50);
        scale([1, 0.7, 0.31]) sphere(d = 50);
    }
}

ukulele();
